text:
@BballRegulator Στα ορεινά και ημιορεινά όσα σπίτια είναι (ήταν) πλίνθινα έχουν τρομερές ζημιές στην καλύτερη περίπτωση. 

Κόσμος έβλεπε στους δρόμους (ποτάμια) να περνάνε ζώα, έπιπλα, ό,τι μπορείς να φανταστείς. 

Για τον κάμπο, τα είδαμε. Ολική καταστροφή.

@AnAthenianToLDN θα μπορουσε να ειναι παρα πολυ χειροτερα 

οταν πεσει τοσο νερο δε μπορεις να μην εχεις πολλες ζημιες 

δες τι εγινε καρδιτσα και λαμια

Ψυχραινει ο καιρός. Να πάρω κασκόλ #Slytherin για το χειμώνα ή το ότι είμαι 31 ετών γομαρι είναι ανασταλτικός παράγοντας λέτε;
_
Spoiler: προφανώς και θα πάρω

⚠️🌀#Ianos avança cap al #Peloponès i continua intensificant-se. 

Ara mateix pareix que comença a intuir-se l'ull 👁️

